defender.vgdl:
SpriteSet {
    wall: Wall;
    avatar: Avatar;
    city: City;
    portalAmmo: PortalAmmo;
    sam: Sam;
    supply: Supply;
}

LevelMapping {
    wall: wall;
    avatar: avatar;
    city: city;
    portalAmmo: portalAmmo;
    sam: sam;
    supply: supply;
}

InteractionSet {
    # Avatar collects items on collision
    When (avatar collides with portalAmmo) {
        Remove portalAmmo;
    }
    When (avatar collides with sam) {
        Remove sam;
    }
    When (avatar collides with supply) {
        Remove supply;
    }
    # Avatar moves through non-wall objects
    When (avatar moves) {
        If (next_cell is wall) {
            Block movement;
        }
    }
}

TerminationSet {
    # Game ends when avatar reaches a specific condition (e.g., collects all items)
    When (all items collected) {
        End game;
    }
}

