racebet.vgdl:
SpriteSet {
    wall
    camelA
    camelB
    camelC
    camelD
    goal
    arena
    pitA
    pitB
    pitC
    pitD
    normal
}

LevelMapping {
    wall: wall
    camelA: camelA
    camelB: camelB
    camelC: camelC
    camelD: camelD
    goal: goal
    arena: arena
    pitA: pitA
    pitB: pitB
    pitC: pitC
    pitD: pitD
    normal: normal
}

InteractionSet {
    # Camels cannot move into pits (collision)
    if (camelA on pitA or camelA on pitB or camelA on pitC or camelA on pitD) {
        remove camelA
    }
    if (camelB on pitA or camelB on pitB or camelB on pitC or camelB on pitD) {
        remove camelB
    }
    if (camelC on pitA or camelC on pitB or camelC on pitC or camelC on pitD) {
        remove camelC
    }
    if (camelD on pitA or camelD on pitB or camelD on pitC or camelD on pitD) {
        remove camelD
    }
    # Camels cannot move into walls (collision)
    if (camelA on wall or camelB on wall or camelC on wall or camelD on wall) {
        remove camelA
        remove camelB
        remove camelC
        remove camelD
    }
}

TerminationSet {
    if (camelA on goal or camelB on goal or camelC on goal or camelD on goal) {
        terminate
    }
}

